import React from 'react';
import { Link } from 'react-router-dom';

function Nav() {
  return (
    <nav>
        <h3>Logo</h3>
        <ul className="nav-links">
            <Link to='/about'>
                <li>About</li>
            </Link>
            <Link>
                <li>Services</li>
            </Link>
            <Link>
                <li>Our Projects</li>
            </Link>
            <Link>
                <li>Contact</li>
            </Link>
        </ul>

    </nav>
  );
}

export default Nav;
